import React from "react";
import { useHistory } from "react-router-dom"; // Імпортують useHistory

function Header() {
    const history = useHistory(); // Створюють об'єкт history

    const navigateToHistory = () => {
        history.push("/history"); // Перехід на сторінку History.js при кліку
    };

    return (
        <header>
            <div className="logo-container">
                <img
                    src="https://www.skrill.com/fileadmin/Personal/promotions/skrill-ac-milan/ac-milan.PNG"
                    alt="AC Milan Logo"
                    className="logo-img"
                />
                <span className="logo-text">AC Milan</span>
                <ul className="nav">
                    {/* Додано обробник події для переходу на сторінку History.js */}
                    <li onClick={navigateToHistory}>Про клуб</li>
                    <li>Основна команда</li>
                    <li>Молодіжна команда</li>
                </ul>
            </div>
            <div className="presentation"></div>
        </header>
    );
}

export default Header;
